  false,\n\t\"url\": null,\n\t\"notes\": \"Reson 8101ER multibeam Data were collected
  on December, 13 and December, 14, 2010 aboard NOAA Survey Launch Acoustic Habitat
  Investigator (AHI) in the Main Hawaiian Islands at Oahu during cruise AHI1012. These
  multibeam data were collected using SAIC ISS-2000 v 4.0.0.3.0 software in the Generic
  Sensor Format and processed using SABER editing software. Sound velocity corrections
  from a Seabird SBE19 CTD sensor and motion corrections from a POS-MV vertical reference
  were applied to the data in real time. Predicted tides were applied to the data
  in real time. Horizontal accuracy is ~5m (differential GPS correctors applied),
  vertical accuracy is depth dependent (~1% of water depth), WGS84 datum. These data
  are not to be used for navigation. Depths mapped range from ~ 4 - 300 m. The AHI
  was deployed from shore.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
